public static Map<String, String> convertStringStringMapProtoListToMap(
    List<StringStringMapProto> pList) {
  Map<String, String> ret = new HashMap<>();
  if (pList != null) {
    for (StringStringMapProto p : pList) {
      if (p.hasKey()) {
        ret.put(p.getKey(), p.getValue());
      }
    }
  }
  return ret;
}
